  [],\n\t\"revision_timestamp\": \"2015-07-08T19:12:57.970696\",\n\t\"name\": \"global-maps-of-atmospheric-nitrogen-deposition-1860-1993-and-2050\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set provides global gridded estimates
  of atmospheric deposition of total inorganic nitrogen (N), NHx (NH3 and NH4+), and
  NOy (all oxidized forms of nitrogen other than N2O), in mg N/m2/year, for the years
  1860 and 1993 and projections for the year 2050. The data set was generated using
  a global three-dimensional chemistry-transport model (TM3) with a spatial resolution
  of 5 degrees longitude by 3.75 degrees latitude (Jeuken et al., 2001; Lelieveld
  and Dentener, 2000). Nitrogen emissions estimates (Van Aardenne et al., 2001) and
  projection scenario data (IPCC, 1996; 2000) were used as input to the model.\",\n\t\"license_title\":
